INSERT OR IGNORE INTO disease_interactions (id, med_id, trade_name, disease_name, interaction_text, severity, reference_text, source, created_at) VALUES (57925, 1408, 'Iron Dextran', 'Hypersensitivity, Immediate', 'Hypersensitivity reactions, including anaphylaxis, have occurred after uneventful test doses as well as therapeutic doses of iron dextran injection, usually within the first several minutes of administration.  Iron dextran should be administered cautiously in patients with a history of significant allergies and/or asthma.  Epinephrine should be immediately available in the event of acute hypersensitivity reactions.', '2', '', 'DDInter', 0);
